import React from "react";
import Wave from "../components/Wave/Wave";
import Navigation from "../components/Navigation/Navigation";

// svg imports
import Css from "../../public/assets/css.svg";
import Firebase from "../../public/assets/firebase.svg";
import Insta from "../../public/assets/insta.svg";
import Github from "../../public/assets/github.svg";
import Grapgql from "../../public/assets/graphql.svg";
import Html from "../../public/assets/html.svg";
import ReactImg from "../../public/assets/react.svg";
import Sass from "../../public/assets/sass.svg";

function bio() {
  return (
    <>
      <header aria-label="primary">
        <Navigation />
      </header>
      <Wave />
      <main>
        <section className="bio container">
          <h2 className="bio__title">&#128214; - Biography</h2>
          <p className="bio__para">
            Curious by nature, and business minded. I'm a self taught, 21 year
            old creative developer with a passion for creating things that live
            on the internet.
          </p>
        </section>

        <section className="skills">
          <div className="container--skill"></div>
        </section>
      </main>
      <Wave flipped={true} />
    </>
  );
}

export default bio;
